import React from "react";
import Tooltip from '@material-ui/core/Tooltip';


function Type() {

    return <Tooltip title="" arrow placement="bottom" >
            <div className="bottomObj hovering" id="type">
                <img src="images/Type_Draw.png" style = {{marginBottom: "0px"}} />
            </div>
        </Tooltip>     
}

export default Type;
